SET NAMES utf8mb4;
SET CHARACTER SET utf8mb4;

CREATE TABLE `Countries` (
  `idCountry` int NOT NULL AUTO_INCREMENT,
  `Name` varchar(55) NOT NULL,
  `RegionName` varchar(55) DEFAULT NULL,
  `RegionCount` int NOT NULL DEFAULT 0,
  PRIMARY KEY (`idCountry`),
  UNIQUE KEY `Name` (`Name`)
) ENGINE=InnoDB AUTO_INCREMENT=197 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;







CREATE TABLE `Territories` (
  `idTerritory` int NOT NULL AUTO_INCREMENT,
  `Name` varchar(55) NOT NULL,
  `Type` varchar(55) DEFAULT NULL,
  `OwnedBy` int NOT NULL,
  `RegionName` varchar(55) DEFAULT NULL,
  `RegionCount` int NOT NULL DEFAULT 0,
  PRIMARY KEY (`idTerritory`),
  UNIQUE KEY `Name` (`Name`),
  KEY `OwnedBy` (`OwnedBy`),
  CONSTRAINT `territories_ibfk_1` FOREIGN KEY (`OwnedBy`) REFERENCES `Countries` (`idCountry`)
) ENGINE=InnoDB AUTO_INCREMENT=54 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;





CREATE TABLE `EuropeanRegions` (
  `idEuropeanRegion` int NOT NULL AUTO_INCREMENT,
  `Name` varchar(55) NOT NULL,
  `Type` varchar(55) DEFAULT NULL,
  `Country` varchar(55) NOT NULL,
  `OtherRegion` json DEFAULT NULL,
  `idCountry` int DEFAULT NULL,
  `idTerritory` int DEFAULT NULL,
  PRIMARY KEY (`idEuropeanRegion`),
  KEY `idCountry_idx` (`idCountry`),
  KEY `idTerritory_idx` (`idTerritory`),
  KEY `Name` (`Name`),
  CONSTRAINT `idCountry` FOREIGN KEY (`idCountry`) REFERENCES `Countries` (`idCountry`),
  CONSTRAINT `idTerritory` FOREIGN KEY (`idTerritory`) REFERENCES `Territories` (`idTerritory`)
) ENGINE=InnoDB AUTO_INCREMENT=514 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;





CREATE TABLE `myRegions` (
  `idRegion` int NOT NULL AUTO_INCREMENT,
  `Name` varchar(100) DEFAULT NULL,
  `Country` varchar(55) NOT NULL,
  `FirstHad` date DEFAULT NULL,
  `RealRegion` json DEFAULT NULL,
  `RealRegionID` int DEFAULT NULL,
  `ISO3166_2` json DEFAULT NULL,
  PRIMARY KEY (`idRegion`),
  KEY `RealRegionID` (`RealRegionID`),
  KEY `Name` (`Name`),
  CONSTRAINT `myregions_ibfk_1` FOREIGN KEY (`RealRegionID`) REFERENCES `EuropeanRegions` (`idEuropeanRegion`)
) ENGINE=InnoDB AUTO_INCREMENT=705 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;